    loaddata() {
      this.unitfundermentals =  this.sormodel.filter(x => x.unitStandardType == "Fundamental");
      this.unitCores =  this.sormodel.filter(x => x.unitStandardType == "Core");
      this.unitElectives =  this.sormodel.filter(x => x.unitStandardType == "Elective");

       this.unitfundermentals.forEach(obj => {
        this.fundermentaltatalval += parseInt(obj.unitstdnNumberoOfCredits);
       }); 

       this.unitCores.forEach(obj => {
        this.corestatalval += parseInt(obj.unitstdnNumberoOfCredits);
       });

       this.unitElectives.forEach(obj => {
        this.electivestatalval += parseInt(obj.unitstdnNumberoOfCredits);
       });

       var requiredelectives = this.fundermentaltatalval +  this.corestatalval;
       var min =  parseInt(this.sormodel[0].qualificationMinimumCredits);
       var mincredits = min - requiredelectives;

       var objs = {TotalFundermental:this.fundermentaltatalval,TotalCores:this.corestatalval,TotalElectives:mincredits};
       this.criditsTable.push(objs);

       var unifun = 0;
       var unco = 0;
       var unel = 0;
       this.sormodel.forEach(obj => {
            if(obj.competencyStatus == "Competent"){
              if(obj.unitStandardType =="Fundamental"){
                unifun += parseInt(obj.unitstdnNumberoOfCredits);
              }else if (obj.unitStandardType =="Core") {
                unco += parseInt(obj.unitstdnNumberoOfCredits);
              }else if (obj.unitStandardType =="Elective"){
                unel += parseInt(obj.unitstdnNumberoOfCredits);
              }
            }
       }); 

       this.totalarchived = unifun + unco + unel;

       var objss = {TotalFundermental:unifun,TotalCores:unco,TotalElectives:unel};
       this.criditsTable.push(objss);

    }

